import "../assets/css/card.css";

function Card({
  image,
  title,
  subtitle,
  dates,
  children,
  tags,
  demoLink,
  sourceLink,
  wide,
}) {
  let classes = "card";
  if (wide) {
    classes = "card wide";
  }

  const tag = tags.map((singleTag))

  return (
    <div className={classes}>
      <img src={image} alt={title} />
      <div className="cardContents">
        <div className="cardTitle">{title}</div>
        <div className="cardSubtitle">
          {subtitle}
          <br />
          {dates}
        </div>
        <div className="cardBody">{children}</div>
        {tags}
      </div>
    </div>
  );
}

export default Card;
